import './App.css';

import React from 'react';
import Home from './components/home';
import About from './pages/About/about'
import {BrowserRouter as Router,  
  Route,
  Routes, 
   } from 'react-router-dom';


function App() {


  return (
    <Router>
     <Routes> 

      <Route exact path="/">
        <React.Fragment>
          <Home />
        </React.Fragment>

      </Route>
     </Routes>

     <Routes>

      <Route exact path='/about'>
        <About/>
      </Route>

     </Routes>
    </Router>



  );
}

export default App;
